.org/licenses/>.\r\n// **************************************************************************\r\n// This script lets you add a note to a sales transaction line\r\n\r\nindex = sales.getSelectedIndex(); \r\nif (index >= 0) {   \r\n    line = ticket.getLine(index);   \r\n    value = javax.swing.JOptionPane.showInputDialog(\"Line notes\", line.getProperty(\"notes\")); \r\n    if (value != null) { \r\n        // the user pressed OK \r\n        line.setProperty(\"notes\", value); \r\n    } \r\n}'),('44','script.Event.Total',0,'// script.Event.Total\r\n// This script requires ALL flagged Remote Printer items to be sent to Remote Printer before Payment\r\n//\r\n//    uniCenta oPOS - Touch Friendly Point Of Sale\r\n//    Copyright (c) 2009-2015 uniCenta\r\n//    http://sourceforge.net/projects/unicentaopos\r\n//\r\n//    This file is part of uniCenta oPOS.\r\n//\r\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n//    it under the terms of the GNU General Public License as published by\r\n//    the Free Software Foundation, either version 3 of the License, or\r\n//    (at your option) any later version.\r\n//\r\n//    uniCenta oPOS is distributed in the hope that it will be useful,\r\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n//    GNU General Public License for more details.\r\n//\r\n//    You should have received a copy of the GNU General Public License\r\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n// **************************************************************************\r\n\r\n\r\nfor(int i= 0; i < ticket.getLinesCount(); i++){\r\n	line = ticket.getLine(i);\r\n	if ($ticketline.isProductKitchen()){\r\n		line.setProperty(\"sendstatus\", \"No\");\r\n	}\r\n	if(line.getProperty(\"sendstatus\").equals(\"No\")){\r\n		mySent = \"No\";\r\n	}\r\n}\r\n\r\nif (mySent == \"No\"){\r\n	javax.swing.JOptionPane.showMessageDialog(null, \"Before closing ticket: Please Send Order to Remote Printer\", \"Send Check\", JOptionPane.WARNING_MESSAGE);\r\n	return \"Cancel\";\r\n}else{\r\n	return null;\r\n}'),('45','script.linediscount',0,'// script.linediscount\n//\n//    uniCenta oPOS - Touch Friendly Point Of Sale\n//    Copyright (c) 2009-2015 uniCenta\n//    http://sourceforge.net/projects/unicentaopos\n//\n//    This file is part of uniCenta oPOS.\n//\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\n//    it under the terms of the GNU General Public License as published by\n//    the Free Software Foundation, either version 3 of the License, or\n//    (at your option) any later version.\n//\n//    uniCenta oPOS is distributed in the hope that it will be useful,\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n//    GNU General Public License for more details.\n//\n//    You should have received a copy of the GNU General Public License\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n// **************************************************************************\n// This script applies UsersInput %Discount for the Item Line value\n// To use in the sales screen: Highlight the line you want to discount\n// Then Tap in the %Discount amount and touch the % button\n\nimport com.openbravo.format.Formats;\nimport com.openbravo.pos.ticket.TicketLineInfo;\nimport com.openbravo.pos.ticket.TicketProductInfo;\n\ndiscountrate = sales.getInputValue()/100;\n\nindex = sales.getSelectedIndex();\nif (index >= 0) {\n    line = ticket.getLine(index);\n    if (line.getPrice() > 0.0 && discountrate > 0.0) {\n\n        sdiscount = Formats.PERCENT.formatValue(discountrate);\n        ticket.insertLine(index + 1,\n            new TicketLineInfo(\n                    \"Line Discount \" + sdiscount,\n                    line.getProductTaxCategoryID(),\n                    line.getMultiply(),\n                    -(double)((line.getPriceTax() * discountrate * 100) / (1+line.getTaxRate()))/100,\n                    line.getTaxInfo()));\n        sales.setSelectedIndex(index + 1);\n    } else {\n         java.awt.Toolkit.getDefaultToolkit().beep();\n    }\n} else {\n    java.awt.Toolkit.getDefaultToolkit().beep();\n}'),('46','script.ReceiptConsolidate',0,'// script.ReceiptConsolidate\r\n// Remove duplicate item entries and ADD\'s Units to first entry of the item\r\n// This script only consolidates items with a valid ProductID \r\n//\r\n//    uniCenta oPOS - Touch Friendly Point Of Sale\r\n//    Copyright (c) 2009-2015 uniCenta\r\n//    http://sourceforge.net/projects/unicentaopos\r\n//\r\n//    This file is part of uniCenta oPOS.\r\n//\r\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n//    it under the terms of the GNU General Public License as published by\r\n//    the Free Software Foundation, either version 3 of the License, or\r\n//    (at your option) any later version.\r\n//\r\n//    uniCenta oPOS is distributed in the hope that it will be useful,\r\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n//    GNU General Public License for more details.\r\n//\r\n//    You should have received a copy of the GNU General Public License\r\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n// **************************************************************************\r\n\r\nimport com.openbravo.format.Formats;\r\nimport com.openbravo.pos.ticket.TicketLineInfo;\r\nimport com.openbravo.pos.ticket.TicketInfo;\r\nimport com.openbravo.pos.ticket.TicketProductInfo; \r\nimport java.util.Properties;\r\n\r\nint numlines = ticket.getLinesCount(); \r\n\r\nfor (int i = 0 ; i < numlines ; i++) {  \r\n 	current_ticketline = ticket.getLine(i);\r\n	current_unit  = current_ticketline.getMultiply();\r\n	if ( current_unit != 0){\r\n		for (int j = i + 1 ; j < numlines ; j++) {\r\n			if ( ticket.getLine(j).getProductID() != null) {\r\n				loop_ticketline = ticket.getLine(j);\r\n				loop_unit  = loop_ticketline.getMultiply();  \r\n 				String current_productid = current_ticketline.getProductID();\r\n				String loop_productid    = loop_ticketline.getProductID();\r\n\r\n				if ( loop_productid.equals(current_productid) && (loop_ticketline.getPrice() == current_ticketline.getPrice()) && (loop_unit != 0) ){\r\n					current_unit = current_unit + loop_unit;\r\n					loop_ticketline.setMultiply(0);	\r\n				}\r\n			}	\r\n		}\r\n	current_ticketline.setMultiply(current_unit);\r\n	}	\r\n }\r\n\r\n\r\n// now remove the ticket lines where the unit = 0\r\n// start deleteing in reverse order\r\n\r\nfor (int i = numlines - 1 ; i > 0 ; i--) { \r\n	loop_ticketline = ticket.getLine(i);\r\n	loop_unit  = loop_ticketline.getMultiply();\r\n	if (loop_unit == 0){\r\n		ticket.removeLine(i);\r\n		\r\n	}\r\n} '),('47','script.Refundit',0,'// script.Refundit.txt\r\n// This script allows an item to be Refunded (or Returned/Exchanged) within a Sale\r\n//\r\n//    uniCenta oPOS - Touch Friendly Point Of Sale\r\n//    Copyright (c) 2009-2015 uniCenta\r\n//    http://sourceforge.net/projects/unicentaopos\r\n//\r\n//    This file is part of uniCenta oPOS.\r\n//\r\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n//    it under the terms of the GNU General Public License as published by\r\n//    the Free Software Foundation, either version 3 of the License, or\r\n//    (at your option) any later version.\r\n//\r\n//    uniCenta oPOS is distributed in the hope that it will be useful,\r\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n//    GNU General Public License for more details.\r\n//\r\n//    You should have received a copy of the GNU General Public License\r\n//    alon