rootWindow ;\n \n//Window[] allWindows = Window.getWindows();\n \n//for (int i=0 ; i < allWindows.length; i++){\n//   if (allWindows[i].getName().equals(\"frame0\")){\n//                 rootWindow = (Window)allWindows[i];\n//             }\n//}\n \n//PosApps posApps = new PosApps();\n \n//posApps.init(ticket,dbURL,dbUser,dbPassword,rootWindow,\"Email\");\n\n\n\nboolean isCash = false;\nString change = \"\";\nPaymentInfo p = ticket.payments.getFirst();\n\nif (\"cash\".equals(p.getName())) {\n    isCash = true;\n    change = p.printChange();\n}\n\n// Get details of the original font before we change it otherwise all dialogboxes will use new settings\nJOptionPane pane = new JOptionPane();\nFont originalFont=pane.getFont();\n\nUIManager.put(\"OptionPane.buttonFont\", new FontUIResource(new Font(\"Saysettha OT\",Font.PLAIN,16)));\nmessage = \"ເງິນທອນ: \" + change;\nJLabel FontText = new JLabel(message);\nFontText.setFont (new Font ( \"Saysettha OT\", Font.BOLD, 28) );\nFontText.setMinimumSize(new java.awt.Dimension(450, 80));\nFontText.setPreferredSize(new java.awt.Dimension(450, 80));\nFontText.setMaximumSize(new java.awt.Dimension(450, 80));\n\nif(isCash) {\n    JOptionPane pane = new JOptionPane();\n	pane.setMessage(FontText);\n	pane.setPreferredSize( new Dimension(500,200));\n	JDialog dialog = pane.createDialog(\"Cash payment\");\n    new Thread(new Runnable() {\n         void run() {\n            dialog.show();\n        }\n    }).start();\n}\n\n// Return to default settings\nUIManager.put(\"OptionPane.buttonFont\", new FontUIResource(new Font(originalFont.getName(),originalFont.getStyle(),originalFont.getSize())));'),('56','Ticket.Discount',0,'import com.openbravo.format.Formats;\nimport com.openbravo.pos.ticket.TicketLineInfo;\nimport com.openbravo.pos.ticket.TicketProductInfo;\n\ndiscountrate = 1 - (sales.getInputValue() / 100.0);\n\nindex = sales.getSelectedIndex();\nif (index >= 0) {\n    line = ticket.getLine(index);\n    if (line.getPrice() > 0.0 && discountrate > 0.0) {\n        sdiscount = Formats.PERCENT.formatValue((1-discountrate));\n        ticket.setLine(index,\n            new TicketLineInfo(\n                    line.getProductID(),\n                    line.getProductName() + \" -\" + sdiscount,\n                    line.getProductTaxCategoryID(),\n                    line.getMultiply(),\n                    line.getPrice () * discountrate,\n                    line.getTaxInfo()));\n        sales.setSelectedIndex(index);\n    } else {\n         java.awt.Toolkit.getDefaultToolkit().beep();\n    }\n} else {\n    java.awt.Toolkit.getDefaultToolkit().beep();\n}\n'),('57','Ticket.Line',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!--\n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2015 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n\n<!-- This sales transaction screen is great for Retailers! -->\n<line>\n    <column name=\"label.item\" width=\"140\" align=\"left\" value=\"&lt;html&gt;#if ($ticketline.isProductCom()) &lt;i&gt;*&amp;nbsp;&amp;nbsp;${ticketline.printName()}&lt;/i&gt; #else ${ticketline.printName()} #end&lt;br&gt;${ticketline.getProductAttSetInstDesc()}\"/>\n    <column name=\"label.price\" width=\"80\" align=\"right\" value=\"${ticketline.printPrice()}\"/